function getElementsByChapter(d){var e=new Array();var c=document.getElementsByTagName("a");var a=c.length;if(!d){var f=new RegExp("(chapter)")}else{var f=new RegExp("(chapter"+d+")")}var b=new RegExp("(level1)");for(i=0,j=0;i<a;i++){if(f.test(c[i].className)&&!b.test(c[i].className)){e[j]=c[i];j++}}return e}function toggleByChapter(b){var c=getElementsByChapter(b);for(var a=0;a<c.length;a++){if(c[a].style.visibility=="visible"){c[a].style.visibility="hidden";c[a].style.display="none"}else{c[a].style.visibility="visible";c[a].style.display="block"}}}function getElementsByClass(e,g,a){var d=new Array();var c=e.getElementsByTagName(a);var b=c.length;var f=new RegExp("(^|\\s)"+g+"(\\s|$)");for(i=0,j=0;i<b;i++){if(f.test(c[i].className)){d[j]=c[i];j++}}return d}function toggle(a){var c=getElementsByClass(document,"toggle","*");for(var b=0;b<c.length;b++){c[b].style.visibility="hidden";c[b].style.display="none"}document.getElementById(a).style.visibility="visible";document.getElementById(a).style.display="block"}function scorm(){document.getElementById("yesAPI").style.display="block";document.getElementById("noAPI").style.display="none"}function noscorm(){document.getElementById("noAPI").style.display="block";document.getElementById("yesAPI").style.display="none"};